import React from "react";
import Particles from "react-tsparticles";

function Particle() {
    return (
        <Particles
            id="tsparticles"
            params={{
                particles: {
                    number: {
                        value: 0
                    },
                    collisions: {
                        enable: false
                    },
                    color: {
                        value: "#ffffff"
                    },
                    shape: {
                        type: "edge"
                    },
                    opacity: {
                        value: { min: 0.2, max: 0.6 }
                    },
                    size: {
                        value: { min: 0.5, max: 7 }
                    },
                    move: {
                        enable: true,
                        size: true,
                        speed: 2,
                        direction: "none",
                        outModes: {
                            default: "destroy"
                        },
                        trail: {
                            enable: true,
                            fillColor: "#000000",
                            length: 3
                        }
                    }
                },
                detectRetina: true,
                background: {
                    color: "#000"
                },
                emitters: {
                    direction: "none",
                    rate: {
                        delay: 0.25,
                        quantity: 10
                    },
                    position: {
                        x: 70,
                        y: 50
                    },
                    size: {
                        width: 0,
                        height: 0
                    },
                },
                absorbers: [
                    {
                        position: { x: 50, y: 50 },
                        size: {
                            value: 50,
                            limit: 60,
                            random: {
                                enable: true,
                                minimumValue: 30
                            }
                        }
                    }
                ],
            }}
        />
    );
}

export default Particle;
